import{_ as e,o as i,c as t,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 50-73.137:1 Effect of cancellation of limited partnership certificate or registration.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/50-73.137:1.md","filePath":"vacode/50-73.137:1.md"}'),a={name:"vacode/50-73.137:1.md"},n=r('<h1 id="§-50-73-137-1-effect-of-cancellation-of-limited-partnership-certificate-or-registration" tabindex="-1">§ 50-73.137:1 Effect of cancellation of limited partnership certificate or registration. <a class="header-anchor" href="#§-50-73-137-1-effect-of-cancellation-of-limited-partnership-certificate-or-registration" aria-label="Permalink to &quot;§ 50-73.137:1 Effect of cancellation of limited partnership certificate or registration.&quot;">​</a></h1><p>A. Whenever the certificate of limited partnership of a domestic limited partnership that is registered as a registered limited liability partnership is canceled, the limited partnership&#39;s registration as a registered limited liability partnership shall thereupon be automatically canceled unless the certificate of limited partnership was canceled pursuant to a conversion to a partnership under § <a href="http://law.lis.virginia.gov/vacode/50-73.126/" target="_blank" rel="noreferrer">50-73.126</a>.</p><p>B. Whenever the certificate of registration to transact business in this Commonwealth of a foreign limited partnership that is registered as a foreign registered limited liability partnership is canceled, the foreign limited partnership&#39;s registration as a foreign registered limited liability partnership shall thereupon be automatically canceled.</p><p>C. A registered limited liability partnership or foreign registered limited liability partnership that has ceased to be a registered limited liability partnership or a foreign registered limited liability partnership under subsection A or B may restore its status as such by complying with the requirements of subsection E of § <a href="http://law.lis.virginia.gov/vacode/50-73.134/" target="_blank" rel="noreferrer">50-73.134</a>.</p><p>2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0378" target="_blank" rel="noreferrer">378</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0601" target="_blank" rel="noreferrer">601</a>; 2009, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0716" target="_blank" rel="noreferrer">716</a>.</p>',5),o=[n];function s(l,c,p,f,h,d){return i(),t("div",null,o)}const _=e(a,[["render",s]]);export{m as __pageData,_ as default};
